window.bookSummaryJSON = "<p>My wannabe friends-to-lovers story is an embarrassing disaster.</p> <p>It all started when I took a chance on love and made a move on the older guy I’ve been obsessed with for years. I experienced something so humiliating, I’m desperate to bleach it from my brain forever.</p> <p>I’ve spent every day since pretending it didn’t happen. That it didn’t matter. That it didn’t hurt.</p> <p>Rocco Monroe came to live with my family when he was eighteen. His bedroom was across from mine. We were friends. He became the son my father never had.</p> <p>When I tried to change our status, he shut me down. He said I was illicit … a forbidden drug formulated just for him.</p> <p>And that’s saying something since he’s a DEA agent.</p> <p>So I cut him out … severed all ties.</p> <p>What I didn’t know was that while I was trying to forget him, he became addicted.</p> <p>To me.</p> <p>The moment he found an opening, he pushed his way back into my life.</p> <p>But my shattered heart might not survive another break.</p> <p>I have two choices.</p> <p>Keep my orderly, Rocco-free life.</p> <p>Or risk everything for the chance to have it all.</p> <p>That is if our families don’t kill us first.</p> <p>You know… figuratively.</p> <p>And literally.</p>"; 
